import React, { Component } from 'react';
import logo from '../trivia.png';

class Login extends Component {
  render() {
    return (
      <header className="App-header">
        <img src={ logo } width="300px" className="App-logo" alt="logo" />
        <p>SUA VEZ</p>
        <form>
          <label htmlFor="name">
            Nome
            <input type="text" name="name" id="name" data-testid="input-player-name" />
          </label>
          <label htmlFor="email">
            Email
            <input
              type="email"
              name="email"
              id="email"
              data-testid="input-gravatar-email"
            />
          </label>
          <button type="button" data-testid="btn-play">Play</button>
        </form>
      </header>
    );
  }
}

export default Login;
